import React from "react";
import { Link } from "react-router-dom";

export default function AdminDashboard() {
  return (
    <div className="page fade-in">
      <img
        src="/logo.png"
        alt="HI AWTO"
        style={{
          width: "130px",
          display: "block",
          margin: "0 auto 10px",
        }}
      />

      <h1 className="page-title" style={{ textAlign: "center" }}>
        Admin Dashboard
      </h1>

      <div style={{ display: "flex", gap: "18px", justifyContent: "center" }}>
        <Link
          to="/admin/messages"
          className="card hover-glow"
          style={{ maxWidth: "260px", textAlign: "left" }}
        >
          <div
            style={{
              fontSize: "18px",
              fontWeight: 600,
              color: "var(--blue)",
            }}
          >
            Messaging Center
          </div>
          <p style={{ fontSize: "0.9rem", color: "#4b5563", marginTop: "6px" }}>
            View and respond to all conversations.
          </p>
        </Link>

        <Link
          to="/my-listings"
          className="card hover-glow"
          style={{ maxWidth: "260px", textAlign: "left" }}
        >
          <div
            style={{
              fontSize: "18px",
              fontWeight: 600,
              color: "var(--green)",
            }}
          >
            Manage Listings
          </div>
          <p style={{ fontSize: "0.9rem", color: "#4b5563", marginTop: "6px" }}>
            Review and update active lease-to-own listings.
          </p>
        </Link>
      </div>
    </div>
  );
}
